import React from "react";
import './comp.css';
import icon from './fox.ico';
function Navbar()
{
    return(
        <header className="Nav">
            <img className="image" src={icon}/>
            <a href='Home'>Home</a>
            <a href='Contact'>Contact</a>
            <a href='Events'>Events</a>
            <a href='tasks'>Tasks</a>
            <a href="cart">Cart</a>
        </header>
    )
}
export default Navbar
